import { StyleSheet } from 'react-native';

import { images, FONTS, SIZES, COLORS2 } from '../../../utils';

const styles = StyleSheet.create({
  container: {
    flex: 1,
    paddingVertical: SIZES.padding,
    backgroundColor: COLORS2.white,
  },
  scrollcContainer: {
    flex: 1,
    paddingHorizontal: SIZES.padding,
  },

  logoContainer: {
    justifyContent: 'center',
    alignItems: 'center',
  },
  touch: {
    height: 90,
    width: 200,
  },
  logo: {
    height: '100%',
    width: '100%',
    // resizeMode: 'center',
  },

  titleContainer: {
    marginTop: SIZES.padding,
    ...titleContainerStyle,
  },
  titleContainer: { textAlign: ' center ', ...FONTS.h2 },
});

export default styles;
